import React from "react";
import Routes from "./Routes"
import { Link } from "react-router-dom"

function App() {
  return (
    <div>
    <h1>Learnifi</h1>
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <Link to="/users">Users</Link>
        </li>
      </ul>
    </nav>
    </div>
  );
};

export default App;
